import React from 'react';
import '../index.css';
import { Button } from './Button';
import '../App.css';
import ImageCarousel from './ImageCarousel';

function Main() {
  return (
    <div className='relative flex flex-col flex-1 h-screen overflow-hidden'>
      <section className='relative grid grid-cols-1 lg:grid-cols-2 h-full'>
        <div className='sm:bg-[#1f1f1f] flex flex-col lg:justify-center text-center lg:text-left gap-6 md:gap-8 lg:gap-10 p-6 lg:p-10 h-full'>
          <h2 className='font-bold text-4xl sm:text-5xl md:text-6xl'>
            Hi! I'm <span className='text-sky-400'>Dev</span> Patel
            <br /> Full Stack
            <span className='text-sky-400'> Developer</span>
          </h2>
          <p className='text-base sm:text-lg md:text-xl text-gray-400'>
            Computer Science | <span className='text-sky-400'>UNC </span>| Business
          </p>
          <Button buttonStyle='btn--primary' buttonSize='btn--large'>
            DISCOVER MORE
          </Button>
        </div>
        <div className='relative bg-[#242422] h-full flex items-center justify-center'>
          <ImageCarousel />
        </div>
      </section>
    </div>
  );
}

export default Main;
